import React from 'react';
import Table from 'react-bootstrap/Table';

class MyTable extends React.Component{
render(){
return (
<Table striped bordered hover size="sm">
  <thead>
    <tr>
      <th>#</th>
      <th>First Name</th>
      <th>Last Name</th>
      <th>Username</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <td>1</td>
      <td>Mark</td>
      <td>Otto</td>
      <td>@mdo</td>
    </tr>
    <tr>
      <td>2</td>
      <td>Jacob</td>
      <td>Thornton</td>
      <td>@fat</td>
    </tr>
    <tr>
      <td>3</td>
      <td colSpan="2">Larry the Bird</td>
      <td>@twitter</td>
    </tr>
  </tbody>
</Table>

)

}

componentDidMount(){
    console.log('Call Service Rest');
    //http://localhost:8080/EmployeeController/employees
    fetch('http://localhost:8080/EmployeeController/employees').then(res =>{
       // console.log(res.json());
    }).then(data=>{
        this.setState({ contacts: data })
        console.log(this.state);
    })
}

}

export default MyTable;
